define({"topics":[{"title":"Restore your <span class=\"ph\">Conductor<\/span> from a database backup","shortdesc":"<p class=\"shortdesc\">If there are unexpected side effects or changes or updates to your <span class=\"ph\">Conductor<\/span>, you can         restore it from a database backup. A database backup restores everything except network         configuration and SSL certificates. If you restore to the same <span class=\"ph\">Conductor<\/span>, your network         configuration and SSL certificates are maintained. If you restore to a different <span class=\"ph\">Conductor<\/span>, it restores         the database without changing the new <span class=\"ph\">Conductor's<\/span> network and         SSL configuration.<\/p>","href":"content\/topics\/restore_cond.html","attributes":{"data-id":"restore_cond"},"menu":{"hasChildren":false},"tocID":"restore_cond-d8884e4461","topics":[]}]});